export default {
  components: {
    topHead: topHead,
    // shareToWeixin: shareToWeixin
  },
  data() {
    return {
      user_info: {},
      show_user_money:true,
      
      version: appconfig.versioncode,
      url: appconfig.cmsbaseurl,

      address_list:[],
      todo_list:[],
      interest_latest:{},

      share_show: false,
      show_share_pupup: false,
      mall_token:"",
    };
  },
  computed: {
    // mall_token(){
    //   return utils.storageGet("mall_token");
    // },
    macross() {
      return this.$store.getters.getMacross;
    },
    phone(){
      var phone = "";
      phone = utils.hideString(this.user_info.mobile_phone,3,4);
      return phone;
    },
    user_money(){
      var user_money = "";
      if(!this.show_user_money){
        user_money = utils.hideString(this.user_info.user_money,0,0);
      }else{
        user_money = this.user_info.user_money;
      }
      return user_money;
    },
    resume_stamp() {
      return this.$store.getters.getResumeStamp;
    },
  },
  beforeRouteEnter(to, from, next) {
    next(vm => {
      // 通过 `vm` 访问组件实例
      vm.init();
      utils.trackEvent("exposure_my");
    })
  },
  watch:{
    resume_stamp:function(nval,oval){//app  reume
      utils.trackEvent("exposure_my");
    },
  },
  mounted() {
    // this.init();
  },
  methods: {
    init: function() {
      this.mall_token = utils.storageGet("mall_token");
      
      this.getUserInfo();
      this.getMyAddressList();
      this.getTodoList();
      this.getInterestLatest();
    },
    getUserInfo: function() {
      var _this = this;
      utils.API.user_info({
        data: {
          token: _this.mall_token,
        }
      })
      .then(function(ret) {
        _this.user_info = _.assign({}, _this.user_info, ret.model.data);
      })
      .catch(function(ret) {
        !ret.__servererror__ && Toast(ret.errorMessage || "未知错误！");
      });
    },
    getMyAddressList:function(cb){
      var _this = this;
      utils.API.address_list({
        data:{
          token: _this.mall_token
        }
      })
      .then(function (ret) {
        _this.address_list = ret.model.data;
        _this.$store.commit('setMallAddress',ret.model.data);
        // console.log("_this.category:",_this.category)
        cb&&cb();
      })
      .catch(function(ret){
        !ret.__servererror__ && Toast(ret.errorMessage||"未知错误！");
      });
    },
    getTodoList:function(){
      var me = this;

      utils.API.todo_list({
        data: {
          "token": me.mall_token,
          "reqBody":{}
        }
      })
      .then(function(ret) {
        me.todo_list = ret.model.items;
      })
      .catch(function(ret) {
        !ret.__servererror__ && Toast(ret.errorMessage || "未知错误！");
      });
    },
    getInterestLatest:function(page){
      var me = this;

      utils.API.user_account_record({
        data: {
          "token": me.mall_token,
          "type": "storage",
          "pagination":{
            count: 1,
            page: 1,
          },
        }
      })
      .then(function(ret) {
        me.interest_latest = ret.model.data&&ret.model.data[0]||{};
      })
      .catch(function(ret) {
        !ret.__servererror__ && Toast(ret.errorMessage || "未知错误！");
      });
    },

    //跳到我的订单页面
    // gotoMyOrder: function(tag) {
